import{_ as n,o as e,c as h,R as t}from"./chunks/framework.EUU6lLMq.js";const b=JSON.parse('{"title":"FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"vi_VN/guide/faq.md","filePath":"vi_VN/guide/faq.md"}'),a={name:"vi_VN/guide/faq.md"},o=t('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h1><h2 id="kernelsu-co-ho-tro-thiet-bi-cua-toi-khong" tabindex="-1">KernelSU có hỗ trợ thiết bị của tôi không? <a class="header-anchor" href="#kernelsu-co-ho-tro-thiet-bi-cua-toi-khong" aria-label="Permalink to &quot;KernelSU có hỗ trợ thiết bị của tôi không?&quot;">​</a></h2><p>Đầu tiên, thiết bị của bạn sẽ có thể mở khóa bootloader. Nếu không thể thì nó không được hỗ trợ.</p><p>Sau đó, cài đặt Ứng dụng KernelSU manager vào thiết bị của bạn và mở nó, nếu nó hiển thị <code>Unsupported</code> thì thiết bị của bạn chưa được hỗ trợ ngay, nhưng bạn có thể tạo nguồn kernel và tích hợp KernelSU để nó hoạt động hoặc sử dụng <a href="./unofficially-support-devices.html">unofficially-support-devices</a>.</p><h2 id="kernelsu-co-can-mo-khoa-bootloader-khong" tabindex="-1">KernelSU có cần mở khóa Bootloader không? <a class="header-anchor" href="#kernelsu-co-can-mo-khoa-bootloader-khong" aria-label="Permalink to &quot;KernelSU có cần mở khóa Bootloader không?&quot;">​</a></h2><p>Chắc chắn có.</p><h2 id="kernelsu-co-ho-tro-cac-mo-đun-khong" tabindex="-1">KernelSU có hỗ trợ các mô-đun không? <a class="header-anchor" href="#kernelsu-co-ho-tro-cac-mo-đun-khong" aria-label="Permalink to &quot;KernelSU có hỗ trợ các mô-đun không?&quot;">​</a></h2><p>Có, nhưng đây là phiên bản đầu tiên nên có thể bị lỗi. Đợi nó ổn định nhé 😃</p><h2 id="kernelsu-co-ho-tro-xposed-khong" tabindex="-1">KernelSU có hỗ trợ Xposed không? <a class="header-anchor" href="#kernelsu-co-ho-tro-xposed-khong" aria-label="Permalink to &quot;KernelSU có hỗ trợ Xposed không?&quot;">​</a></h2><p>Có, <a href="https://github.com/canyie/Dreamland" target="_blank" rel="noreferrer">Dreamland</a> và <a href="https://taichi.cool" target="_blank" rel="noreferrer">TaiChi</a> hiện đã hoạt động. Đối với LSPosed, bạn có thể làm cho nó hoạt động bằng <a href="https://github.com/Dr-TSNG/ZygiskNext" target="_blank" rel="noreferrer">ZygiskNext</a></p><h2 id="kernelsu-co-ho-tro-zygisk-khong" tabindex="-1">KernelSU có hỗ trợ Zygisk không? <a class="header-anchor" href="#kernelsu-co-ho-tro-zygisk-khong" aria-label="Permalink to &quot;KernelSU có hỗ trợ Zygisk không?&quot;">​</a></h2><p>KernelSU không có hỗ trợ Zygisk tích hợp sẵn nhưng thay vào đó, bạn có thể sử dụng <a href="https://github.com/Dr-TSNG/ZygiskNext" target="_blank" rel="noreferrer">ZygiskNext</a>.</p><h2 id="kernelsu-co-tuong-thich-voi-magisk-khong" tabindex="-1">KernelSU có tương thích với Magisk không? <a class="header-anchor" href="#kernelsu-co-tuong-thich-voi-magisk-khong" aria-label="Permalink to &quot;KernelSU có tương thích với Magisk không?&quot;">​</a></h2><p>Hệ thống mô-đun của KernelSU xung đột với magic mount của Magisk, nếu có bất kỳ mô-đun nào được kích hoạt trong KernelSU thì toàn bộ Magisk sẽ không hoạt động.</p><p>Nhưng nếu bạn chỉ sử dụng <code>su</code> của KernelSU thì nó sẽ hoạt động tốt với Magisk: KernelSU sửa đổi <code>kernel</code> và Magisk sửa đổi <code>ramdisk</code>, chúng có thể hoạt động cùng nhau.</p><h2 id="kernelsu-se-thay-the-magisk" tabindex="-1">KernelSU sẽ thay thế Magisk? <a class="header-anchor" href="#kernelsu-se-thay-the-magisk" aria-label="Permalink to &quot;KernelSU sẽ thay thế Magisk?&quot;">​</a></h2><p>Chúng tôi không nghĩ như vậy và đó không phải là mục tiêu của chúng tôi. Magisk đủ tốt cho giải pháp root userspace và nó sẽ tồn tại lâu dài. Mục tiêu của KernelSU là cung cấp giao diện kernel cho người dùng chứ không thay thế Magisk.</p><h2 id="kernelsu-co-the-ho-tro-cac-thiet-bi-khong-phai-gki-khong" tabindex="-1">KernelSU có thể hỗ trợ các thiết bị không phải GKI không? <a class="header-anchor" href="#kernelsu-co-the-ho-tro-cac-thiet-bi-khong-phai-gki-khong" aria-label="Permalink to &quot;KernelSU có thể hỗ trợ các thiết bị không phải GKI không?&quot;">​</a></h2><p>Điều đó là có thể. Nhưng bạn nên tải nguồn kernel về và tích hợp KernelSU vào source tree rồi tự biên dịch kernel.</p><h2 id="kernelsu-co-the-ho-tro-cac-thiet-bi-duoi-android-12-khong" tabindex="-1">KernelSU có thể hỗ trợ các thiết bị dưới Android 12 không? <a class="header-anchor" href="#kernelsu-co-the-ho-tro-cac-thiet-bi-duoi-android-12-khong" aria-label="Permalink to &quot;KernelSU có thể hỗ trợ các thiết bị dưới Android 12 không?&quot;">​</a></h2><p>Chính kernel của thiết bị ảnh hưởng đến khả năng tương thích của KernelSU và nó không liên quan gì đến phiên bản Android. Hạn chế duy nhất là các thiết bị chạy Android 12 phải là kernel 5.10+(thiết bị GKI). Vì thế:</p><ol><li>Các thiết bị chạy Android 12 phải được hỗ trợ.</li><li>Các thiết bị có kernel cũ (Một số thiết bị Android 12 cũng là kernel cũ) tương thích (Bạn nên tự build kernel)</li></ol><h2 id="kernelsu-co-the-ho-tro-kernel-cu-khong" tabindex="-1">KernelSU có thể hỗ trợ kernel cũ không? <a class="header-anchor" href="#kernelsu-co-the-ho-tro-kernel-cu-khong" aria-label="Permalink to &quot;KernelSU có thể hỗ trợ kernel cũ không?&quot;">​</a></h2><p>Có thể, KernelSU hiện đã được backport sang kernel 4.14, đối với kernel cũ hơn, bạn cần backport nó một cách cẩn thận và PR rất đáng hoan nghênh!</p><h2 id="lam-cach-nao-đe-tich-hop-kernelsu-cho-kernel-cu" tabindex="-1">Làm cách nào để tích hợp KernelSU cho kernel cũ? <a class="header-anchor" href="#lam-cach-nao-đe-tich-hop-kernelsu-cho-kernel-cu" aria-label="Permalink to &quot;Làm cách nào để tích hợp KernelSU cho kernel cũ?&quot;">​</a></h2><p>Vui lòng tham khảo <a href="./how-to-integrate-for-non-gki.html">hướng dẫn</a></p><h2 id="tai-sao-phien-ban-android-cua-toi-la-13-va-kernel-hien-thi-android12-5-10" tabindex="-1">Tại sao phiên bản Android của tôi là 13 và kernel hiển thị &quot;android12-5.10&quot;? <a class="header-anchor" href="#tai-sao-phien-ban-android-cua-toi-la-13-va-kernel-hien-thi-android12-5-10" aria-label="Permalink to &quot;Tại sao phiên bản Android của tôi là 13 và kernel hiển thị &quot;android12-5.10&quot;?&quot;">​</a></h2><p>Phiên bản Kernel không liên quan gì đến phiên bản Android, nếu bạn cần flash kernel thì dùng luôn phiên bản kernel, phiên bản Android không quá quan trọng.</p><h2 id="đa-co-mount-namespace-mount-master-global-tren-kernelsu-chua" tabindex="-1">Đã có mount namespace --mount-master/global trên KernelSU chưa? <a class="header-anchor" href="#đa-co-mount-namespace-mount-master-global-tren-kernelsu-chua" aria-label="Permalink to &quot;Đã có mount namespace --mount-master/global trên KernelSU chưa?&quot;">​</a></h2><p>Hiện tại thì không (có thể có trong tương lai), nhưng có nhiều cách để chuyển sang global mount namespace một cách thủ công, chẳng hạn như:</p><ol><li><code>nsenter -t 1 -m sh</code> để lấy shell trong global mount namespace.</li><li>Thêm <code>nsenter --mount=/proc/1/ns/mnt</code> vào lệnh bạn muốn thực thi, sau đó lệnh được thực thi trong global mount namespace. KernelSU cũng <a href="https://github.com/tiann/KernelSU/blob/77056a710073d7a5f7ee38f9e77c9fd0b3256576/manager/app/src/main/java/me/weishu/kernelsu/ui/util/KsuCli.kt#L115" target="_blank" rel="noreferrer">sử dụng cách này</a></li></ol><h2 id="toi-la-gki1-0-toi-co-the-su-dung-cai-nay-khong" tabindex="-1">Tôi là GKI1.0, tôi có thể sử dụng cái này không? <a class="header-anchor" href="#toi-la-gki1-0-toi-co-the-su-dung-cai-nay-khong" aria-label="Permalink to &quot;Tôi là GKI1.0, tôi có thể sử dụng cái này không?&quot;">​</a></h2><p>GKI1 khác hoàn toàn với GKI2, bạn phải tự biên dịch kernel.</p>',33),r=[o];function c(i,l,g,k,s,d){return e(),h("div",null,r)}const p=n(a,[["render",c]]);export{b as __pageData,p as default};
